  const data = [
    {
      sprint1: 'Jane Cooper',
      sprint2: 'jane.cooper@example.com',
      sprint3: 'Regional Paradigm Technician',
      sprint4: 'Optimization',
      sprint5: 'Active',
      sprint6: 'Admin',
      sprint7: 27,
      sprint1: 'https://images.unsplash.com/photo-1494790108377-be9c29b29330?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=facearea&facepad=4&w=256&h=256&q=60',
    },

  ]
  return [...data, ...data, ...data]
}

function WorkLog() {

  const columns = React.useMemo(() => [
    {
      Header: "Name",
      accessor: 'name',
    },
    {
      Header: "Title",
      accessor: 'title',
    },
    {
      Header: "Status",
      accessor: 'status',
    },
    {
      Header: "Age",
      accessor: 'age',
    },
    {
      Header: "Role",
      accessor: 'role',
      Filter: SelectColumnFilter,  // new
      filter: 'includes',
    },
  ], [])

  const data = React.useMemo(() => getData(), [])

  return (
    <>
      <h1>Hello React!</h1>
      <div>
        <Table columns={columns} data={data} />
      </div>
    </>
  );
}

export default WorkLog;
